Freja is much more than a classic e-ID. With Freja, you can access e-services, prove your identity and age with its digital ID card, share your identity with others online, control how your personal data is shared with a secure, government-approved app.

DISCOVER FREJA

The host of features waiting for you in Freja are:

EASY AND SAFE LOGIN
Access connected e-services in Sweden;
QR code login; no typing required;
Approve with biometrics; no passwords required.
DIGITAL ID CARD
Use just like a physical ID;
Prove your identity and age in real life situations;
More and more locations in Sweden accept Freja as an alternative to a physical ID.
PEER-2-PEER IDENTIFICATION
Prove your identity; identify others;
Share your ID with other people via your QR code or via message/social media;
Identify other people by scanning their Freja or receiving a link from them.
ID PROTECTION
A free feature that is in-built into Freja;
Be alerted whenever there is a change to your registered address;
This will give you time to act and protect yourself from fraud.
DIGITAL SIGNATURES
Freja offers legally-binding digital signatures;
Sign contracts and give consent in digital form.
ORGANISATION ID
Freja can separate your private and working e-identities;
Freja is also a solution for temporary devices in workplaces that use a pool of devices.
SEAMLESS TRANSITION AND FLEXIBILITY
The digital aspect of Freja allows great flexibility in use;
Easily transfer Freja to a new device when you get a new phone;
Link up to three email addresses and/or three mobile phone numbers to your account.
ACCESSIBLE TO ALL
Swedes living abroad can get Freja;
People with coordination numbers can get Freja;
People with protected identities can get Freja;
With 'Shared Control' people can link their accounts and help others use Freja.
MY PAGES
View connected services and enable/disable them;
Check which personal data you are sharing;
Add usernames - email addresses and phone numbers;
Manage connected devices;
View the history of your actions.
FULL CONTROL OVER YOUR PERSONAL DATA

Freja is a government-approved solution. This means that it fulfils all Swedish regulations regarding personal data, including GDPR. When it comes to your personal data you can:

Always know what data you are sharing with e-services;
Have a visible history of actions is available in My Pages;
Control which services are enabled/disabled for your personnummer.
HOW TO GET FREJA

Registration in Freja is easy and you can do it in several stages.

CREATE AN ACCOUNT
Verify your email
Set a PIN yourself
BUILD YOUR e-ID
take a photo
add a valid ID document
At this point our security team needs to verify your identity. This can take a few minutes during the day, but longer at night and on weekends. We'll let you know when the check is done.

