EXPLORE WITH FREJA

The 'Explore' tab in Freja contains the latest news and developments connected to Freja, digital security and the tech world. See what the most popular services are, and which services we recommend you try! There will always be something interesting to read and discover in Explore.

SECURITY, COMPLIANCE, TRUST

Freja is the first government-approved mobile e-ID in Sweden. It is fully compliant with Swedish and EU laws and regulations concerning data-handling and privacy. Freja is the approved Swedish solution for eIDAS.

